  private final String code;

  VatDateCode(String code) {
    this.code = code;
  }

  public String getCode() {
    return code;
  }

  public static VatDateCode fromCode(String code) {
    for (VatDateCode ve : values()) {
      if (ve.code.equals(code)) {
        return ve;
      }
    }
    throw new IllegalArgumentException("No VatDateCode with code " + code);
  }

  @Override
  public String toString() {
    return code;
  }
